descricao_acao:
Andréa, Marilise, Vanea e Victor (est.) estiveram presentes no Apoio que tratou sobre:
-Orientações sobre articulação entre gestão municipal e poder judiciário para alinhamento das competências do SUAS;
-Orientações quanto a composição da equipe técnica e papel do advogado no CREAS;
-Orientações quanto a importância de se implantar um CIAMP-Rua no município para fortalecer e institucionalizar os fluxos de atendimento à população em situação de rua em âmbito local;
-Sugestão de agendamento de apoio técnico exclusivo com a equipe da Média Complexidade para alinhamento com toda a equipe do CREAS e gestão municipal.

Reunião n.01/2022 do CIAMP-Rua/MT (Comitê Intersetorial de Acompanhamento e Monitoramento da Política Estadual para a População em situação de Rua de Mato Grosso.
Pautas:
I. Aprovação da Ata de dezembro/2021;
II. Apresentação da Logo;
III. Eleição do(a) novo(a) secretário(a);
IV. Regimento Interno do CIAMP-Rua/MT.

Coordenadora solicitou orientação  referente a uma beneficiaria que recebeu o cartão e não tem mais celular com o aplicativo Caixa Tem.
Orientamos a mesma que  foi emitido o Cartão apenas para os beneficiários que possuem conta Caixa TEM e que o cartão possui a funcionalidade débito e é vinculado à conta do beneficiário. E orientamos também que  para o cadastramento da senha desse cartão é necessário que o beneficiário   acesse o aplicativo Caixa Tem e faça login;
Em seguida, selecione “Auxílio Brasil”;
Agora a opção “Criar senha do cartão”;
Informe a sequência numérica que deseja e confirme.
Outra opção é comparecer até uma agência da Caixa ou nas casas lotéricas para realizar o procedimento.”

Sistema SIGPAB:
1- Aplicativo Controle de Acesso – Login e senha
2- Módulo de Transmissão de Arquivos/Dados – 
3 - Upload/Download de Arquivos Acesso as pastas Raiz – Baixar e filtrar planilhas;
4 - Aplicativo de Adesão Municipal; 
5 -  Aplicativo de Formulários (Sasf); e 
6 - Aplicativo de integração com o Sistema de Condicionalidades (Sicon).

Sistema SICON: 
1 – Quem pode usar o Sicon;
2 - Função Arquivos;
3 - Pesquisa Pessoa – Básica, 
4 - Pesquisa Pessoa – Avançada;
5 – Resultado da pesquisa avançada;
6 -  Consulta Detalhes da Família (aba da família);
7 - Consulta Histórico de Pagamentos;
8 - Pesquisa Avançada de Famílias com Efeito por Descumprimento de Condicionalidades;
9 – Calendários da Gestão de Condicionalidades;

Sistema SECAD 2.0:
1 - Como acessar o CECAD;
2 - Principais funcionalidades do CECAD;
3 - TABCAD: como gerar tabelas simples e cruzadas;
4 – Explorar – Série Histórica;
5 – Baixar – Atual - Base de Dados do CadÚnico;
7 – RI Social;

SISTEMA CADASTRO ÚNICO – V-7:
1 – Cadastramento de entrevistadores e perfil de acesso;
2 – Como gerar e acessar relatórios analíticos;

Navegação no sistema Sistema de Gestão do Programa Auxílio Brasil - SIGPAB;
Navegação no sistema Sistema de Condicionalidades do Programa Auxílio Brasil - SICON;
Navegação no sistema Consulta, Seleção e Extração de Informações do Cadastro Único - CECAD.

Cadastro Único, Conceitos, critérios para cadastramento, faixa de renda, objetivos e dados operacionais do município, sistema do Cadastro Único V-7;
Programa Auxílio Brasil - Conceitos, ingresso das famílias, benefícios da Cesta Raiz, novos beneficiários do PAB, condicionalidades da Saúde, calendário operacional da gestão de condicionalidade;
IGD - Índice e valores repassados aos municípios e utilização de recursos;
Processo de Revisão e Averiguação Cadastral e Focalização PAB/2022;
SigPAB - Mostrei cada aba e quais as funcionalidades e cada relatório;
Intersetorialidade - Estratégias e planejamento;
Navegação no sistema SIBEC, SECAD, SIGPAB E SICON
Sistema V-7 - Como consultar família, como cadastrar pessoa/ família, ações para a família e gerir família.

Orientação sobre o sistema SigPAB.
● Visualizar usuários cadastrados no SigPAB;
● Alterar Dados de Usuários Cadastrados;
● Ativar e Inativar Usuários;
● Atribuição de perfis de usuários existentes no SigPAB;
● Orientação sobre a atualização e confirmação das abas do Termo de Adesão no
SigPAB;
● Como gerar o Termo de Adesão;
● Como fazer o cadastro no SEI;
● Como enviar os documentos no Protocolo Digital no GOv.BR.
